import * as React from "react";
import Box from "@mui/material/Box";

const style = {
    textAlign: "center",
    justifyContent: "center",
    width: "100%",
}

const NotFound = () => {
    return (
        <Box style={style}>
            <h1>Page Not Found</h1>
        </Box>
    )
}

export default NotFound;
